import React from "react";
const Navbar = () =>{
 
    return (
      <Navbar fluid>
        <Navbar.Header>
          <Navbar.Brand>
            <a href="#pablo">{props.brandText}</a>
          </Navbar.Brand>
          <Navbar.Toggle onClick={mobileSidebarToggle} />
        </Navbar.Header>
        <Navbar.Collapse>
          <AdminNavbarLinks />
        </Navbar.Collapse>
      </Navbar>
    );
  
}

export default Header;
